import React from 'react';
import ReactDOM from 'react-dom';
import {Container, Grid} from '@material-ui/core';
import {Skeleton} from '@material-ui/lab'
import TitleBar from './components/TitleBar'
import Summary from './components/Summary'
import TransactionsList from './components/TransactionsList'

import './App.css';

function createData(name, calories, fat) {
  return {name, calories, fat};
}

const rows = [
  createData('Cupcake', 305, 3.7),
  createData('Donut', 452, 25.0),
  createData('Eclair', 262, 16.0),
  createData('Frozen yoghurt', 159, 6.0),
  createData('Gingerbread', 356, 16.0),
  createData('Honeycomb', 408, 3.2),
  createData('Ice cream sandwich', 237, 9.0),
  createData('Jelly Bean', 375, 0.0),
  createData('KitKat', 518, 26.0),
  createData('Lollipop', 392, 0.2),
  createData('Marshmallow', 318, 0),
  createData('Nougat', 360, 19.0),
  createData('Oreo', 437, 18.0)
].sort((a, b) => (
  a.calories < b.calories
  ? -1
  : 1));

function App() {
  const getPlaidAccounts = () => {

    // const storedAccounts = window.localStorage.getItem("plaid_account");
    // if (storedAccounts) {return storedAccounts.json()}
    // else {return false}
    return [
      {
        name: "Natwest",
        balance: 199.44,
        image_url: ""
      }
    ]

  }

  const [accounts, setAccounts] = React.useState(getPlaidAccounts);

  return (<Container maxWidth="sm">
    <TitleBar accounts={accounts} addedAccountChecker={() => setAccounts(getPlaidAccounts())}/>
    <Summary accounts={accounts}/>
    <Grid container justify="center"><Skeleton  variant="rect" width={400} height={200} /></Grid>
    <TransactionsList transactions={rows}/>
  </Container>);
}

export default App;
